import {
  Avatar,
  BottomNavigation,
  BottomNavigationAction,
  Button,
} from "@mui/material";
import React from "react";
import FolderIcon from "@mui/icons-material/Folder";
import HomeIcon from "@mui/icons-material/Home";
import MapsUgcIcon from "@mui/icons-material/MapsUgc";
import LocationOnIcon from "@mui/icons-material/LocationOn";
import image from "../assets/akash.jpg";
import { Favorite } from "@mui/icons-material";

const Footer = () => {
  return (
    <BottomNavigation type sx={{ width: 500,p:0 }}>
      <Button sx={{m:0,p:0}} color="inherit">{<HomeIcon fontSize="large" />}</Button>
      <Button  color="inherit">{<MapsUgcIcon fontSize="large" />}</Button>
      <Button color="inherit">{<Favorite fontSize="large" />}</Button>

      <Button color="inherit">
        {" "}
        <Avatar alt="Remy Sharp" sx={{ width: 35, height: 35 }} src={image} />
      </Button>


    </BottomNavigation>
  );
};

export default Footer;
